def get_symbol_from_query(query: str) -> str:
    """ üéØ ÈÄ≤ÂåñÂæåÁöÑ‰ª£Á¢ºËß£ÊûêÂáΩÊï∏ÔºöÂêåÊôÇÊ™¢Êü• FULL_SYMBOLS_MAP """
    query = query.strip()
    query_upper = query.upper()
    for code, data in FULL_SYMBOLS_MAP.items():
        if query_upper == code: return code
        if any(query_upper == kw.upper() for kw in data["keywords"]): return code 
    for code, data in FULL_SYMBOLS_MAP.items():
        if query == data["name"]: return code
    if re.fullmatch(r'\d{4,6}', query) and not any(ext in query_upper for ext in ['.TW', '.HK', '.SS', '-USD']):
        tw_code = f"{query}.TW"
        if tw_code in FULL_SYMBOLS_MAP: return tw_code
        return tw_code
    return query

@st.cache_data(ttl=3600, show_spinner="Ê≠£Âú®Âæû Yahoo Finance Áç≤ÂèñÊï∏Êìö...")
def get_stock_data(symbol, period, interval):
    try:
        ticker = yf.Ticker(symbol)
        df = ticker.history(period=period, interval=interval)
        
        if df.empty: return pd.DataFrame()
        
        # Áµ±‰∏ÄÂàóÂêçÊ†ºÂºè
        df.columns = [col.capitalize() for col in df.columns] 
        df.index.name = 'Date'
        df = df[['Open', 'High', 'Low', 'Close', 'Volume']]
        
        # Á¢∫‰øùÊï∏ÊìöÊôÇÈñìÊà≥ÊòØÂîØ‰∏ÄÁöÑ (Èò≤Ê≠¢È´òÈ†ªÊï∏ÊìöÈáçË§á)
        df = df[~df.index.duplicated(keep='first')]
        # Âà™Èô§ÊúÄÂæå‰∏ÄË°åÔºàÈÄöÂ∏∏ÊòØÊú™ÂÆåÊàêÁöÑÁï∂Ââç K Á∑öÔºâ
        df = df.iloc[:-1] 
        
        if df.empty: return pd.DataFrame() # ÂÜçÊ¨°Ê™¢Êü•ÊòØÂê¶ÁÇ∫Á©∫
        return df
    except Exception as e:
        return pd.DataFrame()

@st.cache_data(ttl=3600)
def get_company_info(symbol):
    info = FULL_SYMBOLS_MAP.get(symbol, {})
    if info:
        if symbol.endswith(".TW") or symbol.startswith("^TWII"): category, currency = "Âè∞ËÇ° (TW)", "TWD"
        elif symbol.endswith("-USD"): category, currency = "Âä†ÂØÜË≤®Âπ£ (Crypto)", "USD"
        else: category, currency = "ÁæéËÇ° (US)", "USD"
        return {"name": info['name'], "category": category, "currency": currency}
    
    try:
        ticker = yf.Ticker(symbol)
        yf_info = ticker.info
        name = yf_info.get('longName') or yf_info.get('shortName') or symbol
        currency = yf_info.get('currency') or "USD"
        category = "Êú™ÂàÜÈ°û"
        if symbol.endswith(".TW"): category = "Âè∞ËÇ° (TW)"
        elif symbol.endswith("-USD"): category = "Âä†ÂØÜË≤®Âπ£ (Crypto)"
        elif symbol.startswith("^"): category = "ÊåáÊï∏"
        elif currency == "USD": category = "ÁæéËÇ° (US)"
        return {"name": name, "category": category, "currency": currency}
    except:
        return {"name": symbol, "category": "Êú™ÂàÜÈ°û", "currency": "USD"}
    
@st.cache_data
def get_currency_symbol(symbol):
    currency_code = get_company_info(symbol).get('currency', 'USD')
    if currency_code == 'TWD': return 'NT$'
    elif currency_code == 'USD': return '$'
    elif currency_code == 'HKD': return 'HK$'
    else: return currency_code + ' '

# Ê†∏ÂøÉ‰øÆÊ≠£ÔºöÊäÄË°ìÊåáÊ®ôË®àÁÆó - Êé°Áî®ÈÄ≤ÈöéË®≠ÂÆö (10, 50, 200 EMA & 9Êúü RSI/MACD/ATR/ADX)
def calculate_technical_indicators(df):
    
    # ÈÄ≤ÈöéÁßªÂãïÂπ≥ÂùáÁ∑ö (MA)
    df['EMA_10'] = ta.trend.ema_indicator(df['Close'], window=10) # Áü≠Á∑öË∂®Âã¢
    df['EMA_50'] = ta.trend.ema_indicator(df['Close'], window=50) # Èï∑Á∑öË∂®Âã¢
    df['EMA_200'] = ta.trend.ema_indicator(df['Close'], window=200) # ÊøæÈè°
    
    # MACD (ÈÄ≤ÈöéË®≠ÂÆö: Âø´Á∑ö 8, ÊÖ¢Á∑ö 17, ‰ø°ËôüÁ∑ö 9)
    macd_instance = ta.trend.MACD(df['Close'], window_fast=8, window_slow=17, window_sign=9)
    df['MACD_Line'] = macd_instance.macd()
    df['MACD_Signal'] = macd_instance.macd_signal()
    df['MACD'] = macd_instance.macd_diff() # MACD Êü±ÁãÄÂúñ
    
    # RSI (ÈÄ≤ÈöéË®≠ÂÆö: ÈÄ±Êúü 9)
    df['RSI'] = ta.momentum.rsi(df['Close'], window=9)
    
    # Á∂ìÂÖ∏Â∏ÉÊûóÈÄöÈÅì (20, 2)
    df['BB_High'] = ta.volatility.bollinger_hband(df['Close'], window=20, window_dev=2)
    df['BB_Low'] = ta.volatility.bollinger_lband(df['Close'], window=20, window_dev=2)
    
    # ATR (ÈÄ≤ÈöéË®≠ÂÆö: ÈÄ±Êúü 9) - È¢®Èö™ÊéßÂà∂ÁöÑÂü∫Áü≥
    df['ATR'] = ta.volatility.average_true_range(df['High'], df['Low'], df['Close'], window=9)
    
    # ADX (ÈÄ≤ÈöéË®≠ÂÆö: ÈÄ±Êúü 9) - Ë∂®Âã¢Âº∑Â∫¶ÁöÑÊøæÈè°
    df['ADX'] = ta.trend.adx(df['High'], df['Low'], df['Close'], window=9)
    
    # Â¢ûÂä† SMA 20 (Áî®ÊñºÂõûÊ∏¨Âü∫Ê∫ñ)
    df['SMA_20'] = ta.trend.sma_indicator(df['Close'], window=20) 
    
    return df

# get_technical_data_df (Á∂≠ÊåÅ‰∏çËÆä - ÊäÄË°ìÊåáÊ®ôË°®Ê†ºËàáÂà§ËÆÄ)
def get_technical_data_df(df):
    """Áç≤ÂèñÊúÄÊñ∞ÁöÑÊäÄË°ìÊåáÊ®ôÊï∏ÊìöÂíåAIÁµêË´ñÔºå‰∏¶Ê†πÊìöÊÇ®ÁöÑÈÄ≤ÈöéÂéüÂâáÈÄ≤Ë°åÂà§ËÆÄ„ÄÇ"""
    
    if df.empty or len(df) < 200: return pd.DataFrame()

    df_clean = df.dropna().copy()
    if df_clean.empty: return pd.DataFrame()

    last_row = df_clean.iloc[-1]
    prev_row = df_clean.iloc[-2] if len(df_clean) >= 2 else last_row 

    indicators = {}
    
    indicators['ÂÉπÊ†º vs. EMA 10/50/200'] = last_row['Close']
    indicators['RSI (9) ÂãïËÉΩ'] = last_row['RSI']
    indicators['MACD (8/17/9) Êü±ÁãÄÂúñ'] = last_row['MACD']
    indicators['ADX (9) Ë∂®Âã¢Âº∑Â∫¶'] = last_row['ADX']
    indicators['ATR (9) Ê≥¢ÂãïÊÄß'] = last_row['ATR']
    indicators['Â∏ÉÊûóÈÄöÈÅì (BB: 20/2)'] = last_row['Close']
    
    data = []
    
    for name, value in indicators.items():
        conclusion, color = "", "grey"
        
        if 'EMA 10/50/200' in name:
            ema_10 = last_row['EMA_10']
            ema_50 = last_row['EMA_50']
            ema_200 = last_row['EMA_200']

            # Êé°Áî®ÈÄ≤ÈöéÁöÑÂ§öÈ†≠ÊéíÂàóÂà§Êñ∑ (10 > 50 > 200)
            if ema_10 > ema_50 and ema_50 > ema_200:
                conclusion, color = f"**Âº∑Â§öÈ†≠ÔºöMA Â§öÈ†≠ÊéíÂàó** (10>50>200)", "red"
            elif ema_10 < ema_50 and ema_50 < ema_200:
                conclusion, color = f"**Âº∑Á©∫È†≠ÔºöMA Á©∫È†≠ÊéíÂàó** (10<50<200)", "green"
            elif last_row['Close'] > ema_50 and last_row['Close'] > ema_200:
                conclusion, color = f"‰∏≠Èï∑Á∑öÂÅèÂ§öÔºöÂÉπÊ†ºÁ´ô‰∏ä EMA 50/200", "orange"
            else:
                conclusion, color = "‰∏≠ÊÄßÔºöMA Á≥æÁµêÊàñË∂®Âã¢ÁôºÂ±ï‰∏≠", "blue"
        
        elif 'RSI' in name:
            # ÈÄ≤ÈöéÂà§Êñ∑: RSI > 50 Â§öÈ†≠, < 50 Á©∫È†≠„ÄÇ70/30 ÁÇ∫Ë∂ÖË≤∑Ë∂ÖË≥£
            if value > 70:
                conclusion, color = "Ë≠¶ÂëäÔºöË∂ÖË≤∑ÂçÄÂüü (70)ÔºåÊΩõÂú®ÂõûË™ø", "green" 
            elif value < 30:
                conclusion, color = "Âº∑ÂåñÔºöË∂ÖË≥£ÂçÄÂüü (30)ÔºåÊΩõÂú®ÂèçÂΩà", "red"
            elif value > 50:
                conclusion, color = "Â§öÈ†≠ÔºöRSI > 50Ôºå‰ΩçÊñºÂº∑Âã¢ÂçÄÈñì", "red"
            else:
                conclusion, color = "Á©∫È†≠ÔºöRSI < 50Ôºå‰ΩçÊñºÂº±Âã¢ÂçÄÈñì", "green"


        elif 'MACD' in name:
            # Âà§Êñ∑ MACD Êü±ÁãÄÂúñÊòØÂê¶ÊîæÂ§ß
            if value > 0 and value > prev_row['MACD']:
                conclusion, color = "Âº∑ÂåñÔºöÂ§öÈ†≠ÂãïËÉΩÂ¢ûÂº∑ (Á¥ÖÊü±ÊîæÂ§ß)", "red"
            elif value < 0 and value < prev_row['MACD']:
                conclusion, color = "ÂâäÂº±ÔºöÁ©∫È†≠ÂãïËÉΩÂ¢ûÂº∑ (Á∂†Êü±ÊîæÂ§ß)", "green"
            else:
                conclusion, color = "‰∏≠ÊÄßÔºöÂãïËÉΩÁõ§Êï¥ (Êü±ÁãÄÊî∂Á∏Æ)", "orange"
        
        elif 'ADX' in name:
              # ADX > 25 Á¢∫Ë™çÂº∑Ë∂®Âã¢
            if value >= 40:
                conclusion, color = "Âº∑Ë∂®Âã¢ÔºöÊ•µÂº∑Âã¢Ë∂®Âã¢ (Â§öÊàñÁ©∫)", "red"
            elif value >= 25:
                conclusion, color = "Âº∑Ë∂®Âã¢ÔºöÁ¢∫Ë™çÂº∑Âã¢Ë∂®Âã¢ (ADX > 25)", "orange"
            else:
                conclusion, color = "Áõ§Êï¥ÔºöÂº±Âã¢ÊàñÊ©´Áõ§Êï¥ÁêÜ (ADX < 25)", "blue"

        elif 'ATR' in name:
            avg_atr = df_clean['ATR'].iloc[-30:].mean() if len(df_clean) >= 30 else df_clean['ATR'].mean()
            if value > avg_atr * 1.5:
                conclusion, color = "Ë≠¶ÂëäÔºöÊ•µÈ´òÊ≥¢ÂãïÊÄß (1.5x Âπ≥Âùá)", "green"
            elif value < avg_atr * 0.7:
                conclusion, color = "‰∏≠ÊÄßÔºö‰ΩéÊ≥¢ÂãïÊÄß (ÈÜûÈáÄÁ™ÅÁ†¥)", "orange"
            else:
                conclusion, color = "‰∏≠ÊÄßÔºöÊ≠£Â∏∏Ê≥¢ÂãïÊÄß", "blue"

        elif 'Â∏ÉÊûóÈÄöÈÅì' in name:
            high = last_row['BB_High']
            low = last_row['BB_Low']
            range_pct = (high - low) / last_row['Close'] * 100
            
            if value > high:
                conclusion, color = f"Ë≠¶ÂëäÔºöÂÉπÊ†º‰ΩçÊñº‰∏äËªåÂ§ñÂÅ¥ (>{high:,.2f})", "red"
            elif value < low:
                conclusion, color = f"Âº∑ÂåñÔºöÂÉπÊ†º‰ΩçÊñº‰∏ãËªåÂ§ñÂÅ¥ (<{low:,.2f})", "green"
            else:
                conclusion, color = f"‰∏≠ÊÄßÔºöÂú®‰∏ä‰∏ãËªåÈñì ({range_pct:.2f}% ÂØ¨Â∫¶)", "blue"
        
        data.append([name, value, conclusion, color])

    technical_df = pd.DataFrame(data, columns=['ÊåáÊ®ôÂêçÁ®±', 'ÊúÄÊñ∞ÂÄº', 'ÂàÜÊûêÁµêË´ñ', 'È°èËâ≤'])
    technical_df = technical_df.set_index('ÊåáÊ®ôÂêçÁ®±')
    return technical_df

# run_backtest (‰øùÁïô‰∏¶Á¢∫Ë™çÂÖ∂ÁÇ∫ÈáèÂåñÂàÜÊûêÁöÑÈáçË¶ÅÁµÑÊàêÈÉ®ÂàÜ)
def run_backtest(df, initial_capital=100000, commission_rate=0.001):
    """
    Âü∑Ë°åÂü∫Êñº SMA 20 / EMA 50 ‰∫§ÂèâÁöÑÁ∞°ÂñÆÂõûÊ∏¨„ÄÇ
    Á≠ñÁï•: ÈªÉÈáë‰∫§ÂèâË≤∑ÂÖ• (ÂÅöÂ§ö)ÔºåÊ≠ª‰∫°‰∫§ÂèâÊ∏ÖÂÄâ (Ë≥£Âá∫)„ÄÇ
    """
    
    if df.empty or len(df) < 51:
        return {"total_return": 0, "win_rate": 0, "max_drawdown": 0, "total_trades": 0, "message": "Êï∏Êìö‰∏çË∂≥ (Â∞ëÊñº 51 ÈÄ±Êúü) ÊàñË®àÁÆóÈåØË™§„ÄÇ"}

    data = df.copy()
    
    # ÈªÉÈáë/Ê≠ª‰∫°‰∫§Âèâ‰ø°Ëôü
    data['Prev_MA_State'] = (data['SMA_20'].shift(1) > data['EMA_50'].shift(1))
    data['Current_MA_State'] = (data['SMA_20'] > data['EMA_50'])
    data['Signal'] = np.where(
        (data['Current_MA_State'] == True) & (data['Prev_MA_State'] == False), 1, 0 # Buy
    )
    data['Signal'] = np.where(
        (data['Current_MA_State'] == False) & (data['Prev_MA_State'] == True), -1, data['Signal'] # Sell
    )
    
    data = data.dropna()
    if data.empty: return {"total_return": 0, "win_rate": 0, "max_drawdown": 0, "total_trades": 0, "message": "ÊåáÊ®ôË®àÁÆóÂæåÊï∏Êìö‰∏çË∂≥„ÄÇ"}

    # --- Ê®°Êì¨‰∫§ÊòìÈÇèËºØ ---
    capital = [initial_capital]
    position = 0 
    buy_price = 0
    trades = []
    
    for i in range(1, len(data)):
        current_close = data['Close'].iloc[i]
        
        # 1. Buy Signal
        if data['Signal'].iloc[i] == 1 and position == 0:
            position = 1
            buy_price = current_close
            initial_capital -= initial_capital * commission_rate 
            
        # 2. Sell Signal
        elif data['Signal'].iloc[i] == -1 and position == 1:
            sell_price = current_close
            profit = (sell_price - buy_price) / buy_price 
            
            trades.append({ 'entry_date': data.index[i], 'exit_date': data.index[i], 'profit_pct': profit, 'is_win': profit > 0 })
            
            initial_capital *= (1 + profit)
            initial_capital -= initial_capital * commission_rate
            position = 0
            
        current_value = initial_capital
        if position == 1:
            current_value = initial_capital * (current_close / buy_price)
            
        capital.append(current_value)

    # 3. Handle open position
    if position == 1:
        sell_price = data['Close'].iloc[-1]
        profit = (sell_price - buy_price) / buy_price
        
        trades.append({ 'entry_date': data.index[-1], 'exit_date': data.index[-1], 'profit_pct': profit, 'is_win': profit > 0 })
        
        initial_capital *= (1 + profit)
        initial_capital -= initial_capital * commission_rate
        if capital: capital[-1] = initial_capital 

    # --- Ë®àÁÆóÂõûÊ∏¨ÁµêÊûú ---
    total_return = ((initial_capital - 100000) / 100000) * 100
    total_trades = len(trades)
    win_rate = (sum(1 for t in trades if t['is_win']) / total_trades) * 100 if total_trades > 0 else 0
    
    capital_series = pd.Series(capital)
    max_value = capital_series.expanding(min_periods=1).max()
    drawdown = (capital_series - max_value) / max_value
    max_drawdown = abs(drawdown.min()) * 100
    
    return {
        "total_return": round(total_return, 2),
        "win_rate": round(win_rate, 2),
        "max_drawdown": round(max_drawdown, 2),
        "total_trades": total_trades,
        "message": f"ÂõûÊ∏¨ÂçÄÈñì {data.index[0].strftime('%Y-%m-%d')} Âà∞ {data.index[-1].strftime('%Y-%m-%d')}„ÄÇ",
        "capital_curve": capital_series
    }

# calculate_fundamental_rating (Á¢∫Ë™çÂ∑≤Á¥çÂÖ•ÊÇ®ÁöÑ ROE>15%, PE, FCF/Debt ÂéüÂâá)
def calculate_fundamental_rating(symbol):
    """
    ËûçÂêà‰∫Ü 'Âü∫Êú¨Èù¢ÁöÑÂà§Êñ∑Ê®ôÊ∫ñ'ÔºåÁâπÂà•ÊòØ ROE > 15%„ÄÅPE ‰º∞ÂÄº„ÄÅ‰ª•ÂèäÁèæÈáëÊµÅ/Ë≤†ÂÇµÂÅ•Â∫∑Â∫¶„ÄÇ
    """
    try:
        ticker = yf.Ticker(symbol)
        info = ticker.info
        
        # ÊéíÈô§ÊåáÊï∏ÂíåÂä†ÂØÜË≤®Âπ£
        if symbol.startswith('^') or symbol.endswith('-USD'):
            return {
                "Combined_Rating": 0.0, 
                "Message": "‰∏çÈÅ©Áî®ÔºöÊåáÊï∏ÊàñÂä†ÂØÜË≤®Âπ£ÁÑ°Ê®ôÊ∫ñÂü∫Êú¨Èù¢Êï∏Êìö„ÄÇ",
                "Details": None
            }

        roe = info.get('returnOnEquity', 0) 
        trailingPE = info.get('trailingPE', 99) 
        freeCashFlow = info.get('freeCashflow', 0) 
        totalCash = info.get('totalCash', 0)
        totalDebt = info.get('totalDebt', 0) 
        
        # 1. ÊàêÈï∑ËàáÊïàÁéáË©ïÂàÜ (ROE) (Á∏ΩÂàÜ 3)
        roe_score = 0
        if roe > 0.15: roe_score = 3 # ROE > 15% (È†ÇÁ¥öÊ®ôÊ∫ñ)
        elif roe > 0.10: roe_score = 2
        elif roe > 0: roe_score = 1
        
        # 2. ‰º∞ÂÄºË©ïÂàÜ (PE) (Á∏ΩÂàÜ 3)
        pe_score = 0
        if trailingPE < 15 and trailingPE > 0: pe_score = 3 # P/E < 15 (Ê†ºÈõ∑ÂéÑÂßÜÊ®ôÊ∫ñ)
        elif trailingPE < 25 and trailingPE > 0: pe_score = 2 # P/E < 25 (ËÄÉÊÖÆÊàêÈï∑ËÇ°/Ë°åÊ•≠Âπ≥Âùá)
        elif trailingPE < 35 and trailingPE > 0: pe_score = 1
        
        # 3. ÁèæÈáëÊµÅËàáÂÑüÂÇµËÉΩÂäõ (Á∏ΩÂàÜ 3)
        cf_score = 0
        cash_debt_ratio = (totalCash / totalDebt) if totalDebt and totalDebt != 0 else 100 
        
        # FCF > 0, Ë≤†ÂÇµÊØîÁéá < 50% (ÁèæÈáë > ÂÇµÂãô)
        if freeCashFlow > 0 and cash_debt_ratio > 2: 
            cf_score = 3
        elif freeCashFlow > 0 and cash_debt_ratio > 1: 
            cf_score = 2
        elif freeCashFlow > 0: 
            cf_score = 1

        # Á∂úÂêàË©ïÁ¥ö (Á∏ΩÂàÜ 9)
        combined_rating = roe_score + pe_score + cf_score
        
        # Ë©ïÁ¥öËß£ËÆÄ
        if combined_rating >= 7:
            message = "È†ÇÁ¥öÂÑ™Áï∞ (Âº∑Ë≠∑ÂüéÊ≤≥)ÔºöÂü∫Êú¨Èù¢Ê•µÂÅ•Â∫∑Ôºå**ROE > 15%**ÔºåÊàêÈï∑Ëàá‰º∞ÂÄº‰ø±‰Ω≥ÔºåÈÅ©ÂêàÈï∑ÊúüÊåÅÊúâ„ÄÇ"
        elif combined_rating >= 5:
            message = "ËâØÂ•ΩÁ©©ÂÅ•ÔºöË≤°ÂãôÁµêÊßãÁ©©Âõ∫Ôºå‰ΩÜÂèØËÉΩÂú®‰º∞ÂÄºÊàñ ROE ÊñπÈù¢ÊúâÂæÖÂä†Âº∑„ÄÇ"
        elif combined_rating >= 3:
            message = "‰∏≠ÊÄßË≠¶Á§∫ÔºöÂ≠òÂú®Ë≤°ÂãôÂ£ìÂäõÊàñ‰º∞ÂÄºÈÅéÈ´òÔºåÈúÄË≠¶ÊÉïÈ¢®Èö™ÔºàÂ¶ÇÁèæÈáëÊµÅÁÇ∫Ë≤†Ôºâ„ÄÇ"
        else:
            message = "Âü∫Êú¨Èù¢ËºÉÂº±ÔºöË≤°ÂãôÊåáÊ®ô‰∏ç‰Ω≥ÊàñÊï∏ÊìöÁº∫Â§±Ôºå‰∏çÂª∫Ë≠∞Áõ≤ÁõÆÈÄ≤Â†¥„ÄÇ"
            
        return { "Combined_Rating": combined_rating, "Message": message, "Details": info }

    except Exception as e:
        return { "Combined_Rating": 1.0, "Message": f"Âü∫Êú¨Èù¢Êï∏ÊìöÁç≤ÂèñÂ§±ÊïóÊàñ‰∏çÈÅ©Áî® (‰ª£Á¢ºÂèØËÉΩÈåØË™§ÊàñÊï∏ÊìöÁº∫Â§±)„ÄÇ", "Details": None }

# generate_expert_fusion_signal (Á¢∫Ë™çÂ∑≤Á¥çÂÖ• ATR R:R È¢®Èö™ÁÆ°ÁêÜÂíåÂ§öÊåáÊ®ôËûçÂêà)
# ‚≠êÔ∏è ÂÑ™Âåñ 2: ‰øÆÊ≠£Á≠ñÁï•Âª∫Ë≠∞‰∏≠ÁöÑÂÉπÊ†ºÈ°ØÁ§∫Ê†ºÂºèÔºå‰ΩøÂÖ∂Â∞ç‰ΩéÂÉπ/Âä†ÂØÜË≤®Âπ£Êõ¥Á≤æÁ¢∫
def generate_expert_fusion_signal(df, fa_rating, is_long_term=True, currency_symbol="$"):
    """
    ËûçÂêà‰∫ÜÁ≤æÁ¢∫ÁöÑÊäÄË°ìÂàÜÊûêÊ®ôÊ∫ñ (MA ÊéíÂàó„ÄÅRSI 50 ‰∏≠Ëª∏„ÄÅMACD ÂãïËÉΩ„ÄÅADX ÊøæÈè°) 
    ‰∏¶Á¥çÂÖ•‰∫Ü ATR È¢®Èö™ÊéßÂà∂ (TP/SL) Âíå R:R 2:1 ÁöÑÂéüÂâá„ÄÇ
    """
    
    df_clean = df.dropna().copy()
    if df_clean.empty or len(df_clean) < 2:
        return {'action': 'Êï∏Êìö‰∏çË∂≥', 'score': 0, 'confidence': 0, 'strategy': 'ÁÑ°Ê≥ïË©ï‰º∞', 'entry_price': 0, 'take_profit': 0, 'stop_loss': 0, 'current_price': 0, 'expert_opinions': {}, 'atr': 0}

    last_row = df_clean.iloc[-1]
    prev_row = df_clean.iloc[-2]
    current_price = last_row['Close']
    atr_value = last_row['ATR']
    adx_value = last_row['ADX'] 
    
    expert_opinions = {}
    
    # 1. ÂùáÁ∑ö‰∫§ÂèâËàáÊéíÂàóÂ∞àÂÆ∂ (MA Cross & Alignment)
    ma_score = 0
    ema_10 = last_row['EMA_10']
    ema_50 = last_row['EMA_50']
    ema_200 = last_row['EMA_200']
    
    prev_10_above_50 = prev_row['EMA_10'] > prev_row['EMA_50']
    curr_10_above_50 = ema_10 > ema_50
    
    if not prev_10_above_50 and curr_10_above_50:
        ma_score = 3.5 # ÈªÉÈáë‰∫§Âèâ
        expert_opinions['Ë∂®Âã¢ÂàÜÊûê (MA ‰∫§Âèâ)'] = "**üöÄ ÈªÉÈáë‰∫§Âèâ (GC)**ÔºöEMA 10 Âêë‰∏äÁ©øË∂ä EMA 50ÔºåÂº∑ÂãÅÁúãÊº≤‰ø°ËôüÔºÅ"
    elif prev_10_above_50 and not curr_10_above_50:
        ma_score = -3.5 # Ê≠ª‰∫°‰∫§Âèâ
        expert_opinions['Ë∂®Âã¢ÂàÜÊûê (MA ‰∫§Âèâ)'] = "**üíÄ Ê≠ª‰∫°‰∫§Âèâ (DC)**ÔºöEMA 10 Âêë‰∏ãÁ©øË∂ä EMA 50ÔºåÂº∑ÂãÅÁúãË∑å‰ø°ËôüÔºÅ"
    elif ema_10 > ema_50 and ema_50 > ema_200:
        ma_score = 2.0 # Âº∑Â§öÈ†≠ÊéíÂàó (10 > 50 > 200)
        expert_opinions['Ë∂®Âã¢ÂàÜÊûê (MA ÊéíÂàó)'] = "Âº∑Âã¢Â§öÈ†≠ÊéíÂàóÔºö**10 > 50 > 200**ÔºåË∂®Âã¢ÁµêÊßãÁ©©Âõ∫„ÄÇ"
    elif ema_10 < ema_50 and ema_50 < ema_200:
        ma_score = -2.0 # Âº∑Á©∫È†≠ÊéíÂàó
        expert_opinions['Ë∂®Âã¢ÂàÜÊûê (MA ÊéíÂàó)'] = "Âº∑Âã¢Á©∫È†≠ÊéíÂàóÔºö**10 < 50 < 200**ÔºåË∂®Âã¢ÁµêÊßãÂ¥©ÊΩ∞„ÄÇ"
    elif curr_10_above_50:
        ma_score = 1.0
        expert_opinions['Ë∂®Âã¢ÂàÜÊûê (MA ÊéíÂàó)'] = "Â§öÈ†≠ÔºöEMA 10 ‰ΩçÊñº EMA 50 ‰πã‰∏ä„ÄÇ"
    else:
        ma_score = -1.0
        expert_opinions['Ë∂®Âã¢ÂàÜÊûê (MA ÊéíÂàó)'] = "Á©∫È†≠ÔºöEMA 10 ‰ΩçÊñº EMA 50 ‰πã‰∏ã„ÄÇ"

    # 2. ÂãïËÉΩÂ∞àÂÆ∂ (RSI 9)
    momentum_score = 0
    rsi = last_row['RSI']
    
    if rsi > 60:
        momentum_score = -2.0 
        expert_opinions['ÂãïËÉΩÂàÜÊûê (RSI 9)'] = "Ë≠¶ÂëäÔºöRSI > 60ÔºåÂãïËÉΩÈÅéÁÜ±ÔºåÊΩõÂú®ÂõûË™øÂ£ìÂäõÂ§ß„ÄÇ"
    elif rsi < 40:
        momentum_score = 2.0 
        expert_opinions['ÂãïËÉΩÂàÜÊûê (RSI 9)'] = "Âº∑ÂåñÔºöRSI < 40ÔºåÂãïËÉΩ‰Ωé‰ΩçÔºåÊΩõÂú®ÂèçÂΩàÁ©∫ÈñìÂ§ß„ÄÇ"
    elif rsi > 50: 
        momentum_score = 1.0 
        expert_opinions['ÂãïËÉΩÂàÜÊûê (RSI 9)'] = "Â§öÈ†≠ÔºöRSI > 50 ‰∏≠Ëª∏ÔºåÁ∂≠ÊåÅÂú®Âº∑Âã¢ÂçÄÂüü„ÄÇ"
    else:
        momentum_score = -1.0 
        expert_opinions['ÂãïËÉΩÂàÜÊûê (RSI 9)'] = "Á©∫È†≠ÔºöRSI < 50 ‰∏≠Ëª∏ÔºåÁ∂≠ÊåÅÂú®Âº±Âã¢ÂçÄÂüü„ÄÇ"

    # 3. Ë∂®Âã¢Âº∑Â∫¶Â∞àÂÆ∂ (MACD 8/17/9 & ADX 9)
    strength_score = 0
    macd_diff = last_row['MACD']
    prev_macd_diff = prev_row['MACD']

    # MACD ÂãïËÉΩ
    if macd_diff > 0 and macd_diff > prev_macd_diff:
        strength_score += 1.5
        expert_opinions['Ë∂®Âã¢Âº∑Â∫¶ (MACD)'] = "Â§öÈ†≠ÔºöMACD Êü±ÁãÄÂúñÊîæÂ§ßÔºåÂ§öÈ†≠ÂãïËÉΩÂº∑ÂãÅ„ÄÇ"
    elif macd_diff < 0 and macd_diff < prev_macd_diff:
        strength_score -= 1.5
        expert_opinions['Ë∂®Âã¢Âº∑Â∫¶ (MACD)'] = "Á©∫È†≠ÔºöMACD Êü±ÁãÄÂúñÊîæÂ§ßÔºåÁ©∫È†≠ÂãïËÉΩÂº∑ÂãÅ„ÄÇ"
    else:
        strength_score += 0
        expert_opinions['Ë∂®Âã¢Âº∑Â∫¶ (MACD)'] = "‰∏≠ÊÄßÔºöMACD Êü±ÁãÄÂúñÊî∂Á∏ÆÔºåÂãïËÉΩÁõ§Êï¥„ÄÇ"

    # ADX Á¢∫Ë™ç (ADX > 25 Á¢∫Ë™çÂº∑Ë∂®Âã¢)
    if adx_value > 25:
        strength_score *= 1.5 # Ë∂®Âã¢Âº∑Â∫¶Â§ßÊñº 25 ÊôÇÔºåÂº∑Âåñ‰ø°Ëôü
        expert_opinions['Ë∂®Âã¢Âº∑Â∫¶ (ADX 9)'] = f"**Á¢∫Ë™çÂº∑Ë∂®Âã¢**ÔºöADX {adx_value:.2f} > 25Ôºå‰ø°ËôüÊúâÊïàÊÄßÈ´ò„ÄÇ"
    else:
        expert_opinions['Ë∂®Âã¢Âº∑Â∫¶ (ADX 9)'] = f"Áõ§Êï¥ÔºöADX {adx_value:.2f} < 25Ôºå‰ø°ËôüÊúâÊïàÊÄßÈôç‰Ωé„ÄÇ"


    # 4. KÁ∑öÂΩ¢ÊÖãÂ∞àÂÆ∂
    kline_score = 0
    is_up_bar = last_row['Close'] > last_row['Open']
    is_strong_up = is_up_bar and (last_row['Close'] - last_row['Open']) > atr_value * 0.7 
    is_strong_down = not is_up_bar and (last_row['Open'] - last_row['Close']) > atr_value * 0.7

    if is_strong_up:
        kline_score = 1.0
        expert_opinions['KÁ∑öÂΩ¢ÊÖãÂàÜÊûê'] = "Âº∑ÂåñÔºöÂØ¶È´îÂ§ßÈôΩÁ∑öÔºà> 0.7 ATRÔºâÔºåË≤∑Áõ§Á©çÊ•µ„ÄÇ"
    elif is_strong_down:
        kline_score = -1.0
        expert_opinions['KÁ∑öÂΩ¢ÊÖãÂàÜÊûê'] = "ÂâäÂº±ÔºöÂØ¶È´îÂ§ßÈô∞Á∑öÔºà> 0.7 ATRÔºâÔºåË≥£Â£ìÊ≤âÈáç„ÄÇ"
    else:
        kline_score = 0
        expert_opinions['KÁ∑öÂΩ¢ÊÖãÂàÜÊûê'] = "‰∏≠ÊÄßÔºöKÁ∑öÂØ¶È´îÂ∞èÔºåËßÄÊúõ„ÄÇ"

    # 5. ËûçÂêàË©ïÂàÜ (Á¥çÂÖ• FA Score)
    fa_normalized_score = ((fa_rating / 9) * 6) - 3 if fa_rating > 0 else 0
    fusion_score = ma_score + momentum_score + strength_score + kline_score + fa_normalized_score
    
    # ÊúÄÁµÇË°åÂãï
    action = "ËßÄÊúõ (Neutral)"
    if fusion_score >= 4.0: action = "Ë≤∑ÈÄ≤ (Buy)"
    elif fusion_score >= 1.0: action = "‰∏≠ÊÄßÂÅèË≤∑ (Hold/Buy)"
    elif fusion_score <= -4.0: action = "Ë≥£Âá∫ (Sell/Short)"
    elif fusion_score <= -1.0: action = "‰∏≠ÊÄßÂÅèË≥£ (Hold/Sell)"
        
    # ‰ø°ÂøÉÊåáÊï∏
    MAX_SCORE = 13.75 
    confidence = min(100, max(0, 50 + (fusion_score / MAX_SCORE) * 50))
    
    # È¢®Èö™ÊéßÂà∂Ëàá‰∫§ÊòìÁ≠ñÁï• (R:R 2:1 ÁöÑÂéüÂâá)
    risk_multiple = 2.0 # ‰ΩøÁî® 2.0 ATR ‰ΩúÁÇ∫È¢®Èö™ÂñÆ‰Ωç (ÊÇ®ÁöÑÈ¢®Èö™ÁÆ°ÁêÜÂéüÂâá)
    reward_multiple = 2.0 # ËøΩÊ±Ç 2:1 ÁöÑÂõûÂ†±È¢®Èö™ÊØî
    
    entry_buffer = atr_value * 0.3 # ÂÖÅË®± 0.3 ATR ÁöÑÁ∑©Ë°ù
    
    # ‚≠êÔ∏è ÂÑ™ÂåñÂÉπÊ†ºÈ°ØÁ§∫Á≤æÂ∫¶: Â¶ÇÊûúÂÉπÊ†º‰ΩéÊñº 100 Ââá‰ΩøÁî® 4 ‰ΩçÂ∞èÊï∏ÔºåÂê¶Ââá‰ΩøÁî® 2 ‰Ωç
    price_format = ".4f" if current_price < 100 and not currency_symbol == 'NT$' else ".2f"
    
    if action in ["Ë≤∑ÈÄ≤ (Buy)", "‰∏≠ÊÄßÂÅèË≤∑ (Hold/Buy)"]:
        entry = current_price - entry_buffer
        stop_loss = entry - (atr_value * risk_multiple)
        take_profit = entry + (atr_value * risk_multiple * reward_multiple)
        strategy_desc = f"Âü∫Êñº{action}‰ø°ËôüÔºåÂª∫Ë≠∞Âú® **{currency_symbol}{entry:{price_format}} (¬± {entry_buffer:,.4f})** ÁØÑÂúçÂÖßÂ∞ãÊâæÊîØÊíêÊàñÁ≠âÂæÖÂõûË™øÈÄ≤Â†¥„ÄÇ"
    elif action in ["Ë≥£Âá∫ (Sell/Short)", "‰∏≠ÊÄßÂÅèË≥£ (Hold/Sell)"]:
        entry = current_price + entry_buffer
        stop_loss = entry + (atr_value * risk_multiple)
        take_profit = entry - (atr_value * risk_multiple * reward_multiple)
        strategy_desc = f"Âü∫Êñº{action}‰ø°ËôüÔºåÂª∫Ë≠∞Âú® **{currency_symbol}{entry:{price_format}} (¬± {entry_buffer:,.4f})** ÁØÑÂúçÂÖßÂ∞ãÊâæÈòªÂäõÊàñÁ≠âÂæÖÂèçÂΩàÂæåÈÄ≤Â†¥„ÄÇ"
    else:
        entry = current_price
        stop_loss = current_price - atr_value
        take_profit = current_price + atr_value
        strategy_desc = "Â∏ÇÂ†¥‰ø°ËôüÊ∑∑‰∫ÇÔºåÂª∫Ë≠∞Á≠âÂæÖË∂®Âã¢ÊòéÊúóÊàñÂú®ÂçÄÈñìÂÖßÊìç‰Ωú„ÄÇ"

    return {
        'action': action,
        'score': round(fusion_score, 2),
        'confidence': round(confidence, 0),
        'strategy': strategy_desc,
        'entry_price': entry,
        'take_profit': take_profit,
        'stop_loss': stop_loss,
        'current_price': current_price,
        'expert_opinions': expert_opinions,
        'atr': atr_value
    }

def create_comprehensive_chart(df, symbol, period_key):
    df_clean = df.dropna().copy()
    if df_clean.empty: return go.Figure().update_layout(title="Êï∏Êìö‰∏çË∂≥ÔºåÁÑ°Ê≥ïÁπ™Ë£ΩÂúñË°®")

    fig = make_subplots(rows=3, cols=1, 
                        shared_xaxes=True, 
                        vertical_spacing=0.08,
                        row_heights=[0.6, 0.2, 0.2],
                        subplot_titles=(f"{symbol} ÂÉπÊ†ºËµ∞Âã¢ (ÈÄ±Êúü: {period_key})", "MACD ÊåáÊ®ô", "RSI/ADX ÊåáÊ®ô"))

    # 1. ‰∏ªÂúñÔºöKÁ∑öËàáÂùáÁ∑ö (EMA 10, 50, 200)
    fig.add_trace(go.Candlestick(x=df_clean.index, open=df_clean['Open'], high=df_clean['High'], low=df_clean['Low'], close=df_clean['Close'], name='KÁ∑ö', increasing_line_color='#cc0000', decreasing_line_color='#1e8449'), row=1, col=1)
    fig.add_trace(go.Scatter(x=df_clean.index, y=df_clean['EMA_10'], line=dict(color='#ffab40', width=1), name='EMA 10'), row=1, col=1) 
    fig.add_trace(go.Scatter(x=df_clean.index, y=df_clean['EMA_50'], line=dict(color='#0077b6', width=1.5), name='EMA 50'), row=1, col=1) 
    fig.add_trace(go.Scatter(x=df_clean.index, y=df_clean['EMA_200'], line=dict(color='#800080', width=1.5, dash='dash'), name='EMA 200'), row=1, col=1) 
    
    # 2. MACD Âúñ (MACD Line Âíå Signal Line)
    colors = np.where(df_clean['MACD'] > 0, '#cc0000', '#1e8449') 
    fig.add_trace(go.Bar(x=df_clean.index, y=df_clean['MACD'], name='MACD Êü±ÁãÄÂúñ', marker_color=colors, opacity=0.5), row=2, col=1)
    fig.add_trace(go.Scatter(x=df_clean.index, y=df_clean['MACD_Line'], line=dict(color='#0077b6', width=1), name='DIF'), row=2, col=1)
    fig.add_trace(go.Scatter(x=df_clean.index, y=df_clean['MACD_Signal'], line=dict(color='#ffab40', width=1), name='DEA'), row=2, col=1)
    fig.update_yaxes(title_text="MACD", row=2, col=1)

    # 3. RSI Âúñ (ÂåÖÂê´ ADX)
    fig.add_trace(go.Scatter(x=df_clean.index, y=df_clean['RSI'], line=dict(color='purple', width=1.5), name='RSI'), row=3, col=1)
    fig.add_hline(y=70, line_dash="dash", line_color="red", row=3, col=1, annotation_text="Ë∂ÖË≤∑ (70)", annotation_position="top right")
    fig.add_hline(y=50, line_dash="dash", line_color="grey", row=3, col=1, annotation_text="Â§ö/Á©∫ÂàÜÁïå (50)", annotation_position="top left")
    fig.add_hline(y=30, line_dash="dash", line_color="green", row=3, col=1, annotation_text="Ë∂ÖË≥£ (30)", annotation_position="bottom right")
    fig.update_yaxes(title_text="RSI", range=[0, 100], row=3, col=1)
    
    # ADX - ‰ΩøÁî®Á¨¨‰∫åÂÄã Y Ëª∏ (Âè≥ÂÅ¥)
    fig.add_trace(go.Scatter(x=df_clean.index, y=df_clean['ADX'], line=dict(color='#cc6600', width=1.5, dash='dot'), name='ADX', yaxis='y4'), row=3, col=1)
    fig.update_layout(yaxis4=dict(title="ADX", overlaying='y3', side='right', range=[0, 100], showgrid=False))
    fig.add_hline(y=25, line_dash="dot", line_color="#cc6600", row=3, col=1, annotation_text="Âº∑Âã¢Ë∂®Âã¢ (ADX 25)", annotation_position="bottom left", yref='y4')

    fig.update_layout(
        xaxis_rangeslider_visible=False,
        hovermode="x unified",
        margin=dict(l=20, r=20, t=40, b=20),
        height=700,
        legend=dict(orientation="h", yanchor="bottom", y=1.02, xanchor="right", x=1)
    )

    return fig

